import React from 'react';
import '../App.css';
import HeroSection from '../components/Hero/HeroSection';
import { Card } from "../components/Cards/Cards";
import {
  homeOjbFive,
  homeOjbFour,
  homeOjbOne,
  homeOjbSix,
  homeOjbThree,
  homeOjbTwo,
} from "./Data";


function Home() {
  return (
    <>
      <HeroSection />
      <Card {...homeOjbOne} />
      <card {...homeOjbTwo} />
      <card {...homeOjbThree} />
      <card {...homeOjbFour} />
      <card {...homeOjbFive} />
      <card {...homeOjbSix} />

    </>
  );
}

export default Home;
